import img from '../public/airbnb-header.jpg'

const Home = () => {
    return (
        <>
            <header style={{backgroundImage: `url(${img})`}} className="w-full h-64 bg-cover bg-no-repeat">This is working!</header>
        </>
    )
}

export default Home;
